import React from 'react';
import './WelcomeMessage.css';

const WelcomeMessage = () => {
  return (
    <div className="welcome-message">
      <h1 className="welcome-title">Welcome to the E-Library</h1>
      <p className="welcome-subtitle">Your gateway to a world of books and knowledge.</p>
    </div>
  );
};

export default WelcomeMessage;
